import Head from "next/head";
import Navbar from "./Navbar";
import StateProvider from "./context/";

const Layout = (props) => {
  return (
    <StateProvider>
      <Head>
        <title>To Do App</title>
        <link
          rel="stylesheet"
          href="https://bootswatch.com/4/cerulean/bootstrap.min.css"
        />
      </Head>
      <Navbar />
      {props.children}
    </StateProvider>
  );
};

export default Layout;
